using eCommerceBase.Domain.AggregateModels;
using eCommerceBase.Domain.Constant;
using eCommerceBase.Domain.SeedWork;
using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;

namespace eCommerceBase.Persistence.EntityConfigurations
{
    public class ProductEC : IEntityTypeConfiguration<Product>, ISeed<Product>
    {
        public void Configure(EntityTypeBuilder<Product> builder)
        {
            builder.HasKey(x => x.Id);
            builder.HasIndex(x => x.BrandId);
            builder.HasIndex(x => x.CategoryId);
            builder.HasIndex(x => x.Slug);
            builder.HasIndex(x => x.Deleted);
        }

        public List<Product> GetSeedData()
        {
            var productId = Guid.Parse("d3c1b385-475e-457e-8df5-def8feef2af9");
            var product = new Product("Lorem ipsum dolor sit amet", Guid.Parse("d3c1b385-475e-457e-8df5-def8feef2af9"),
                Guid.Parse("d3c1b385-475e-457e-8df5-def8feef2af9"), "Exem Content", "Exem Gtin", "Exem Sku");
            product.SetId(productId);
            product.SetSlug("exem-product");
            product.AddProductPhotoList(new ProductPhoto(productId, "data:image/jpeg;base64,"));
            var productStock = new ProductStock(1, 1, Guid.Parse("d3c1b385-475e-457e-8df5-def8feef2af9"), productId, 10, Guid.Parse("d3c1b385-475e-457e-8df5-def8feef2af9"));
            productStock.AddDiscountProductList(new DiscountProduct(DiscountTypeConst.ProductPercentDiscount, productStock.Id, 2));
            product.AddProductStockList(productStock);
            return [product];
        }
    }
}
